'use strict'

import React, {
  Component,
  StyleSheet,
  View,
  Text,
  TabBarIOS,
  TouchableHighlight,
  PropTypes,
  Image
} from 'react-native';
import { UP, DOWN } from '../constant/home';

const upbase64Icon = 'data:image/png;base64,';
const downbase64Icon = 'data:image/png;base64,';

export default class Home extends Component {

  constructor(props) {
    super(props);
  }

  _onPressButton() {
    const { actions } = this.props;
    actions.hideTapText();
    actions.getDirection();

    setTimeout(function() { 
      actions.showTapText(); 
      actions.hideDirection();
    }, 2000);
  }

  renderImages() {

    const { currentDirection } = this.props;
    const curIcon = currentDirection == UP ? upbase64Icon : ( currentDirection == 
      DOWN ? downbase64Icon : '');

    return (
      <View>
        {currentDirection !='' ?
        <Image
          style={styles.icon}
          source={{uri: curIcon, scale: 3}}
        />
        : null}
      </View>
    );
  }

  render () {
    const { tapTextShow } = this.props;
    return (
      <View style={styles.container}>
        {this.renderImages()}
        <TouchableHighlight onPress={this._onPressButton.bind(this)}>
          <Text style={styles.tapText}>
            {tapTextShow ? 'Tap for Direction' : ''}
          </Text>
        </TouchableHighlight>
      </View>
    )
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center'
  },
  tapText: {
    fontSize: 40,
    marginTop: 20
  },
  icon: {
    width: 100,
    height: 100,
    marginTop: 300
  },
  logo: {
    width: 100,
    height: 100,
    marginTop: 40
  }
})

Home.propTypes = {
  currentDirection: PropTypes.string,
  tapTextShow: PropTypes.bool,
  actions: PropTypes.object
}
